INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','Regulamin dostaw','conditions, delivery, delay, shipment, pack','<h3>Przesyłki i zwroty</h3>\n<h2>Twoja przesyłka paczkowa</h2>\n<p>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i wysyłane za pośrednictwem firmy UPS z funkcją śledzenia i wysyłania bez podpisu. Jeśli preferujesz dostawę przez UPS Extra z wymaganym podpisem, zostaną naliczone dodatkowe koszty, dlatego skontaktuj się z nami przed wybraniem tej metody. Niezależnie od wyboru wysyłki, udostępnimy link do śledzenia przesyłki online.</p>\n<p>Opłaty za wysyłkę obejmują opłaty manipulacyjne i koszty pakowania oraz koszty wysyłki. Opłaty za obsługę są stałe, a opłaty za przewóz różnią się w zależności od całkowitej wagi przesyłki. Radzimy grupować produkty w jednym zamówieniu. Nie możemy grupować dwóch odrębnych zamówień złożonych osobno, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Twój pakiet zostanie wysłany na twoje własne ryzyko, ale szczególną ostrożność podchodzi do ochrony delikatnych przedmiotów.</p>\n<p>Pudełka mają duży rozmiar, a twoje przedmioty są dobrze chronione.</p>','dostawa'),(2,1,1,'Nota Prawna','Nota Prawna','nota,prawna','<h2>Ta strona internetowa została stworzona przy użyciu oprogramowania open source PrestaShop ™.</h2>','nota-prawna'),(3,1,1,'Regulamin Użytkowania','Regulamin Użytkowania','regulamin,uzytkowania,sprzedaz','<h2>Nasz regulamin użytkowania:</h2>\n<h3>Zasada 1</h3>\n<p>Nie kradnij</p>\n<h3>Zasada 2</h3>\n<p>Nie zostawiaj na ostatnią chwilę</p>','regulamin-uzytkowania'),(4,1,1,'O nas','Dowiedz się czegoś o nas','about us, informations','<h2>O Nas</h2>\n<h3>Nasza firma</h3>\n<p>Jesteśy na rynku od 2017 roku, sprzedajmy żywność</p>\n<h3>Nasza ekipa</h3>\n<p>Japko, Sumek, Kamol, Fufr</p>\n<h3></h3>','o-nas'),(5,1,1,'Bezpieczne płarności','Bezpieczne płarności','secure payment, ssl, visa, mastercard, paypal','<h2>Bezpieczne płatności</h2>\n<h3>Nasze płatności są zabezpieczone najlepszymi protokołami</h3>\n<p>SSL gwarantuje Państwu 100% bezpieczeństwa</p>','bezpieczne-platnosci');
